import { Runner } from ".";

type Props = {
  runner: Runner;
};

const TableRow: React.FC<Props> = ({ runner }) => {
  return (
    <div className="flex">
      <div className="flex-1">
        <div className="flex-1 border-r border-gray-500 px-2 py-1 font-medium">
          {runner.firstName}
        </div>
        <div className="flex-1 border-r border-gray-500 px-2 py-1 font-medium">
          {runner.lastName}
        </div>
        <div className="flex-1 border-r border-gray-500 px-2 py-1 font-medium">
          {runner.speed}
        </div>
        <div className="flex-1 border-r border-gray-500 px-2 py-1 font-medium">
          {runner.token}
        </div>
      </div>
    </div>
  );
};

export default TableRow;
